import styled from "styled-components";

const Section = styled.section`
  height: 100vh;
`;

const H2 = styled.h2`
  text-align: center;
  display: flex;
  justify-content: center;
  align-item: center;
`;


function FindPassword() {
    return (
      <Section>
        <H2> 비밀번호 찾기 </H2>
      </Section>
    )
}

export default FindPassword
